import React, { Component } from "react";
import { Link } from "react-router-dom";

class Navbar extends Component {
  render() {
    return (
      <div>
        <h1 className="navHeader">Back of The Net</h1>
        <ul className="NavLinks">
          <li>Matches</li>
          <li>Players</li>
          <li>Live Watch</li>
        </ul>
      </div>
    );
  }
}

export default Navbar;
